import React from "react";
import "./index.css";

function Status(){
    return(
        <div className="background">
            <div className="flexbox1">
                <div className="">
                    <h1 className="headingblack">STP Category 1</h1>
                    <br/>
                    <text className="white">BWSSB</text>
                </div>

            </div>
        
        </div>
    )
}
export default Status;
